import { Control } from "./Control";

interface SysTime{
    dayOfWeek:number;
    year:number;
    month:number;
    day:number;
    hour:number;
    minute:number;
    second:number;
    milliseconds:number;
}

export class DateTime extends Control{
    setTime(time:SysTime):void;
    getTime():SysTime;
}
